import { Route, Routes } from 'react-router-dom';
import MatchSummary from './components/MatchSummary';
import PlayerPerformance from './components/PlayerPerformance';
import Chatbot from './components/Chatbot';
import VirtualAssistant from './components/VirtualAssistant';
import VirtualCommentator from './components/VirtualCommentator';
import FocusInput from './components/FocusInput';
import './App.css';
import Navbar from './components/Navbar';

function App() {
  return (    
    <div className="App">
      <Navbar/>
      <Routes>
        {/* <Route path="/" element={<Navbar />} /> */}
        <Route path="/match-summary" element={<MatchSummary />} />
        <Route path="/player-performance" element={<PlayerPerformance />} />
        <Route path="/chatbot" element={<Chatbot />} />
        <Route path="/virtual-assistant" element={<VirtualAssistant />} />
        <Route path="/virtual-commentator" element={<VirtualCommentator />} />
        <Route path="/focus-input" element={<FocusInput />} />
      </Routes>
    </div>
  );
}

export default App;
